import React, {useState} from 'react'
import {Link, NavLink} from 'react-router-dom'
import { Icon } from 'semantic-ui-react';
import translate from '../i18n/translate';
import {I18nProvider, LOCALES} from '../i18n';

const Navbar = () => {
    const[locale, setLocale] = useState(LOCALES.ENGLISH);
    return (
        <I18nProvider locale={locale}>
         {/* <div className="container">
              <button onClick={() => setLocale(LOCALES.ENGLISH)}>English</button>
              <button onClick={() => setLocale(LOCALES.CHINESE)}>Chinese</button>
        </div> */}
        <nav className="nav-wrapper grey darken-3">
            <div className = "container">
            <Icon name='paw' size='big' />
                <a className="brand-logo">{translate('cutepet')}</a>
                <ul className="right">
                    <li><Link to="/">{translate('homw')}</Link></li>
                    <li><Link to="/adoption">{translate('adpt')}</Link></li>
                    <li><Link to="/help">{translate('help')}</Link></li>
                </ul>
            </div> 
        </nav>
        <div className="fixed-bottom">
              <button onClick={() => setLocale(LOCALES.ENGLISH)}>English</button>
              <button onClick={() => setLocale(LOCALES.CHINESE)}>Chinese</button>
        </div>
        </I18nProvider>
    )
}

export default Navbar;
